import './App.css';

const lista = [1, 2, 3, 4, 5];
const listItems = lista.map((el => <li>{el}</li>));

function App() {
  return (
    <div>
      <header>        
      </header>
      <body>
        <div>
          <ul>{listItems}</ul>
        </div>
      </body>
    </div>
  );
}

export default App;
